    date_of_death: null,
    nationality: "American",
    bio:
      "Michael James Massimino is an American professor of mechanical engineering at Columbia University and a former NASA astronaut. He is the senior advisor of space programs at the Intrepid Sea, Air & Space Museum.\r\n\r\nEarly life Massimino was born August 19, 1962 in Oceanside, New York, and raised in Franklin Square, New York, both on Long Island. He graduated from H. Frank Carey Junior-Senior High School in Franklin Square, New York in 1980. He went on to attend Columbia University, graduating with a Bachelor of Science degree in Industrial Engineering in 1984. He then attended the Massachusetts Institute of Technology, graduating with a Master of Science degree in Mechanical Engineering and a Master of Science degree in Technology and Public Policy in 1988. He continued his education at MIT, earning a Degree of Mechanical Engineer in 1990 and a Doctor of Philosophy degree in Mechanical Engineering in 1992.",
