    date_of_birth: "1964-02-21",
    date_of_death: null,
    nationality: "American",
    bio:
      "Scott Joseph Kelly is an engineer, retired American astronaut, and a retired U.S. Navy Captain. A veteran of four space flights, Kelly commanded the International Space Station (ISS) on Expeditions 26, 45, and 46.\r\n\r\nKelly's first spaceflight was as pilot of Space Shuttle Discovery, during STS-103 in December 1999. This was the third servicing mission to the Hubble Space Telescope, and lasted for just under eight days. Kelly's second spaceflight was as mission commander of STS-118, a 12-day Space Shuttle mission to the International Space Station in August 2007. Kelly's third spaceflight was as commander of Expedition 26 on the ISS. He arrived 9 October 2010, on a Russian Soyuz spacecraft, during Expedition 25, and served as a flight engineer until it ended. He took over command of the station on 25 November 2010, at the start of Expedition 26 which began officially when the spacecraft Soyuz TMA-19 undocked, carrying the previous commander of the station, Douglas H. Wheelock. Expedition 26 ended on 16 March 2011 with the departure of Soyuz TMA-01M. This was Kelly's first long-duration spaceflight.\r\n\r\nIn November 2012, Kelly was selected, along with Mikhail Korniyenko, for a year-long mission to the International Space Station. Their year in space commenced 27 March 2015 with the start of Expedition 43, continued through the entirety of Expeditions 44, and 45, both of which Kelly commanded. He passed command to Timothy Kopra on 29 February 2016, when the ISS 11-month mission ended. He returned to Earth aboard Soyuz TMA-18M on 1 March 2016.",
