    bio:
      "Igor Petrovich Volk (Russian: Игорь Петрович Волк; Ukrainian: Ігор Петрович Волк; 12 April 1937 – 3 January 2017) was a cosmonaut and test pilot in the Soviet Union.\r\nIgor Volk was selected as a cosmonaut on 12 July 1977 and flew as Research Cosmonaut on Soyuz T-12, the 7th expedition to Salyut 7. One goal of the mission was to test the effects of long-duration spaceflight on Volk's return flight piloting as a precursor to piloting the Space Shuttle Buran. He served as the head of cosmonaut training for the Buran program and after the project's cancellation, as a Flight Tests Deputy at the Gromov Flight Research Institute in 1995 before retiring in 1996. He previously served as President of the National Aero Club of Russia and Vice President of the Fédération Aéronautique Internationale. As recognition for his contributions as a test pilot and cosmonaut he was awarded the Hero of the Soviet Union on 29 July 1984.",
